import scpData from './scpData.json'

function Item({ scpData })
{
    return (
        <div>
            <h1>{selectedItem.ItemNum}</h1>
            <p><img src={scpData.image} alt={scpData.name} /></p>
            <p><strong>Class: </strong>{scpData.class}</p>
            <p><strong>Containment: </strong>{scpData.containment}</p>
            <p><strong>Description: </strong>{scpData.description}</p>
        </div>
    );
}

export default Item;
